import React, { Component } from 'react';
import {
    MDBNavbar, MDBNavbarBrand, MDBNavbarNav, MDBNavItem, MDBNavLink, MDBNavbarToggler, MDBCollapse, MDBIcon, MDBLink, MDBBtn
} from "mdbreact";
import { BrowserRouter as Router } from 'react-router-dom';
import logo from '../../assets/images/common/logo_quickfood.png'

class HeaderNotLogin extends Component {
    state = {
        collapseID: ''
    };

    toggleCollapse = collapseID => () =>
        this.setState(prevState => ({
            collapseID: prevState.collapseID !== collapseID ? collapseID : ''
        }));
    render() {
        const { isOpen, collapseID } = this.state;
        return (
            <Router>
                <MDBNavbar light expand="lg" className="pt-0 pb-0 px-5">
                    <MDBNavbarBrand>
                        <strong className='white-text'>MDBNavbar</strong>
                    </MDBNavbarBrand>
                    <MDBNavbarToggler
                        onClick={this.toggleCollapse('navbarCollapse3')}
                    />
                    <MDBCollapse id='navbarCollapse3' isOpen={collapseID} navbar>
                        <MDBNavbarNav right>
                            <MDBNavItem>
                                <MDBLink className='waves-effect waves-light' to='#!'>
                                    <MDBIcon icon='envelope' className='mr-1' />
                                    Contact
                                </MDBLink>
                            </MDBNavItem>
                            <MDBNavItem>
                                <MDBLink className='waves-effect waves-light' to='#!'>
                                    <MDBIcon icon='cog' className='mr-1' />
                                    Settings
                                </MDBLink>
                            </MDBNavItem>
                            <MDBNavItem>
                                <MDBNavLink className="waves-effect waves-light" to="#!">
                                    <MDBBtn color="warning" outline>
                                        <MDBIcon icon="shopping-cart" className="mr-2" />
                                        Giỏ hàng
                                    </MDBBtn>
                                    <span className="counter">22</span>
                                </MDBNavLink>
                            </MDBNavItem>
                        </MDBNavbarNav>
                    </MDBCollapse>
                </MDBNavbar>
            </Router>
        );
    }
}

export default HeaderNotLogin;
